Это было удивительно – впервые в жизни прокатиться по дороге, которая совсем не далеко от нашего города, и посмотреть на ранее незнакомые пейзажи ближнего Подмосковья, а также на привычные пересекаемые шоссе с совершенно новых ракурсов. На станции Икша, до которой время в пути составило менее часа, мы пробыли всего 13 минут и на этой же электричке поехали обратно, причём уже после первой остановки мы с Петей остались вдвоём в вагоне – как в такси!

Самым сложным в поездке (как и ожидалось) оказался выход из поезда по лестнице. На платформе «142-й км» наш вагон оказался в числе тех, кто остановился за пределами коротких пассажирских плит, и спускаться на камни мы не рискнули – поехали дальше до конечной станции «Поварово-3», где перебрались поближе к началу состава, и через несколько минут опять на этом же электропоезде вернулись обратно и уже успешно вышли из электрички.

Да, по сути это была просто поездка «туда-обратно» и «экскурсия» из вагонных окон. Но она стоила того, потому что здесь очень хотел прокатиться увлеченный железнодорожной темой Петя, я и сам здесь проехался в первый раз, да и вообще среди жителей нашего города многие даже не знают про такой маршрут. И ещё важный момент: в сентябре с каждой днём темнеет всё раньше, и уже через неделю из окон поезда на таком вечернем рейса будет мало что видно, а обратная дорога станет ещё холоднее. К тому же электрички на данном направлении периодически отменяются, а осенняя погода зачастую бывает очень переменчивой. Поэтому никогда не сто́ит откладывать подобные планы в долгий ящик на «потом» и «как-нибудь».";}i:199;a:1:{s:14:"comments_count";i:1;}i:200;a:1:{s:11:"likes_count";i:13;}i:201;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEu6QzXCZBi";}i:202;a:1:{s:5:"image";s:249:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/p1080x1080/118825022_415632686075489_6904694406717266449_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=105&_nc_ohc=6B-nN6I2lNEAX-6BzLT&oh=02f894c5b21c3370b03cba5743b306ed&oe=5F7C4485";}i:203;a:1:{s:4:"type";s:7:"sidecar";}i:204;a:1:{s:8:"owner_id";i:3590137384;}i:205;a:1:{s:14:"owner_username";s:0:"";}i:206;a:1:{s:14:"owner_fullname";s:0:"";}i:207;a:1:{s:9:"owner_pic";s:0:"";}i:208;a:1:{s:2:"id";s:19:"2391096682407496694";}i:209;a:1:{s:10:"short_code";s:11:"CEu4cOag4v2";}i:210;a:1:{s:12:"created_time";i:1599260958;}i:211;a:1:{s:7:"caption";s:1533:"www.KILAfm.com @KILAfm @theINshow
